import styled from 'styled-components';


const LoginContainer = styled.div`
  border: 1px solid green;
  width: 50%;
  padding: 4px;
  margin: 3px auto;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;

const LoginForm = styled.div`
  border: 3px solid darkorchid;
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
  align-content: space-evenly;
`;

const LoginInfoContainer = styled.div`
  border: 1px solid crimson;
  display: flex;
  width: 80%;
  justify-content: center;
  flex-direction: column;
  align-items: center;
  margin: 35px;
`;

const LoginInfo = styled.div`
  border: 1px solid deeppink;
  width: 60%;
  display: flex;
  flex-direction: column;
  margin: 5px;
`;

const LoginButton = styled.div`
  outline-style: none;
  border-radius: 5px;
  margin: 4px;
  text-align: center;
  background: green;
  border: 1px solid seagreen;
  background: #00C800;
  width: 20%;
  &hover {
  background: seagreen;
  color: white;
  font-weight: bold; 
  }
`;

const SignUpContainer = styled.div`
  border: 1px solid deeppink;
  width: 65%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  align-content: center;
  margin: 35px;
`;

const SignUpTagLine = styled.div`
  border: 1px solid purple;
  padding: 3px;
  margin: 5px;
  text-align: center;
`;

const SignUpButton = styled.div`
  outline-style: none;
  border-radius: 5px;
  margin: 10px;
  border: 1px solid seagreen;
  background: lightskyblue;
  width: 40%;



`;





export {LoginContainer,
        LoginForm,
        LoginInfoContainer,
        LoginInfo,
        LoginButton,
        SignUpContainer,
        SignUpTagLine,
        SignUpButton,


};
